import MatchDetailButton from "./matchDetailButton";

export default function MatchControlPanel() {
    return(
      <div className={"mt-3 py-3 mb-3"} style={styleContainer}>
            <div className={"flex flex-row gap-3 lg:px-20 py-5"}>
                <MatchDetailButton text={"Přehled"}></MatchDetailButton>
                <MatchDetailButton text={"sestavy"}></MatchDetailButton>
                <MatchDetailButton text={"statistiky"}></MatchDetailButton>
                <MatchDetailButton text={"hráči"}></MatchDetailButton>
                <MatchDetailButton text={"analytika"}></MatchDetailButton>
                <MatchDetailButton text={"sázení"}></MatchDetailButton>
            </div>
      </div>
    );
}

const styleContainer = {
    backgroundColor: "#241F55",
    fontWeight: "bold",
    textTransform: "uppercase",
    borderBottomRightRadius: "20px",
    borderBottomLeftRadius: "20px"
}
